<p class=""text3"" align=""justify""> Jack é um alcoólatra, que bebeu muito especialmente durante a noite do dia das
  bruxas.
  Nessa noite,
  o diabo veio levar sua alma. Os dois fazem um trato. Jack pediu que o diabo virasse uma moeda para que ele pudesse
  tomar sua última bebida. O diabo concorda. Jack coloca o diabo em forma de moeda em sua carteira, que por sua vez,
  possui, um símbolo de cruz, o que prende o diabo ali. O diabo só é libertado ao fazer um acordo com Jack, no qual,
  ele
  poderia viver mais um ano.
  <br>
  <br>
  No ano seguinte, Jack consegue enganar o diabo novamente. Mas morre espontaneamente logo depois. Por ser um
  alcoólatra, ele não foi aceito no céu. Então indo para o inferno, ele dá de cara com o diabo que havia enganado.O
  diabo enfurecido, também não o quis no inferno e o mandou para a noite escura com apenas uma brasa de carvão para
  iluminar o caminho.
  <br>
  <br>
  Para guiar seus caminhos, Jack teria colocado o carvão em um nabo esculpido, fazendo a");
